function customLogin(a,b){var c=ds.Admin.find("user==:1",a),d=ds.Organisation.find("user==:1",a),e=ds.User.find("phone==:1",a);return c?c.validatePassword(b)?{ID:c.ID,name:c.user,fullName:c.user,belongsTo:["Administrator"]}:{error:1,errorMessage:"Password is incorrect"}:d?d.validatePassword(b)?{ID:d.ID,name:d.user,fullName:d.name,belongsTo:["Organisation"]}:{error:2,errorMessage:"Password is incorrect"}:e?e.validatePassword(b)?{ID:e.ID,name:e.phone,fullName:e.name,belongsTo:["Mobile"]}:{error:3,errorMessage:"Password is incorrect"}:{error:4,errorMessage:"User is incorrect"}}